--- create database china_base_info;
create table area_code (
    id  bigint unsigned NOT NULL AUTO_INCREMENT comment '主键' , 
    province char(2) not null comment '省份',
    city char(2) not null DEFAULT '00' comment  '市',
    district char(2) not null DEFAULT '00' comment '区县',
    is_deleted tinyint unsigned NOT NULL default 0 comment '数据是否删除 0：使用中，1:删除',
    description varchar(15) not null,
    remark varchar(128) ,
    gmt_create  datetime NOT NULL comment '创建时间 yyyymmdd hh24miss',
    gmt_modified  datetime NOT NULL comment '更新时间 yyyymmdd hh24miss',
    PRIMARY KEY (id)
) engine=InnoDB DEFAULT charset=utf8;
ALTER TABLE area_code comment '地区代码';
CREATE UNIQUE INDEX uk_area ON area_code(province, city, district);

